define('tmpl!core/templates/webidl/callback.html', ['handlebars'], function (hb) { return hb.compile('<span class=\'idlCallback\' id=\'idl-def-{{obj.refId}}\'>{{extAttr obj indent true\n}}{{idn indent}}callback <span class=\'idlCallbackID\'>{{obj.id\n}}</span> = <span class=\'idlCallbackType\'>{{datatype obj.datatype}}{{arr}}{{nullable}}</span> ({{{children}}});</span>\n');});


define('tmpl!core/templates/webidl/method.html', ['handlebars'], function (hb) { return hb.compile('<span class=\'idlMethod\'>{{extAttr obj indent true\n}}{{idn indent}}{{static}}<span class=\'idlMethType\'>{{datatype obj.datatype}}{{arr}}{{nullable}}</span> {{pads pad\n}}<span class=\'idlMethName\'><a href=\'#{{id}}\'>{{obj.id}}</a></span> ({{{children}}});</span>\n');});


define('tmpl!core/templates/webidl/constructor.html', ['handlebars'], function (hb) { return hb.compile('<span class=\'idlCtor\'>{{extAttr obj indent true\n}}{{idn indent}} <span class=\'idlCtorKeyword\'>{{keyword}}</span><span class=\'idlCtorName\'><a href=\'#{{id}}\'>{{name}}</a></span>{{param obj children}}</span>');});


define('tmpl!core/templates/webidl/attribute.html', ['handlebars'], function (hb) { return hb.compile('<span class=\'idlAttribute\'>{{extAttr obj indent true\n}}{{idn indent}}{{declaration}} attribute <span class=\'idlAttrType\'>{{datatype obj.datatype}}{{arr}}{{nullable}}</span> {{pads\npad}}<span class=\'idlAttrName\'><a href=\'#{{href}}\'>{{obj.id}}</a></span>;</span>\n');});


define('tmpl!core/templates/webidl/serializer.html', ['handlebars'], function (hb) { return hb.compile('<span class=\'idlSerializer\'>{{extAttr obj indent true\n}}{{idn indent}}serializer{{#if values}} = <span class=\'idlSerializerValues\'>{{values}}</span>{{/if}};</span>\n');});


define('tmpl!core/templates/webidl/iterable.html', ['handlebars'], function (hb) { return hb.compile('<span class=\'idlIterable\'>{{extAttr obj indent true\n}}{{idn indent}}iterable&lt;<span class=\'idlIterableKeyType\'>{{datatype obj.key}}</span>{{#if obj.value}},<span class=\'idlIterableValueType\'>{{datatype obj.value}}</span>{{/if}}&gt;;</span>\n');});


define('tmpl!core/templates/webidl/maplike.html', ['handlebars'], function (hb) { return hb.compile('<span class=\'idlMaplike\'>{{extAttr obj indent true\n}}{{idn indent}}{{readonly}}maplike&lt;<span class=\'idlMaplikeKeyType\'>{{datatype obj.key}}</span>, <span class=\'idlMaplikeValueType\'>{{datatype obj.value}}</span>&gt;;</span>\n');});


define('tmpl!core/templates/webidl/comment.html', ['handlebars'], function (hb) { return hb.compile('<span class=\'idlSectionComment\'>{{extAttr obj indent true\n}}{{idn indent}}// {{comment}}</span>\n');});


